CKEDITOR.plugins.add('dispostamp', {   
   requires : ['richcombo'],
   init : function(editor) {
	   var config = editor.config,
       lang = editor.lang.format;

	   // Gets the list of tags from the settings.
	   var tags = []; //new Array();
	   //this.add('value', 'drop_text', 'drop_label');
	   tags[0] = ['<img src="data:image/jpeg;base64,"/>', "Dismissed After Hearing", "Dismissed After Hearing"];
	   tags[1] = ['<img src="data:image/jpeg;base64,"/>', "Dismissed Before Hearing", "Dismissed Before Hearing"];
	   tags[2] = ['<img src="data:image/jpeg;base64,"/>', "Dismissed by Default", "Dismissed by Default"];
	   tags[3] = ['<img src="data:image/jpeg;base64,"/>', "Disposed by Judge", "Disposed by Judge"];
	   tags[4] = ['<img src="data:image/jpeg;base64,"/>', "Disposed by Jury Trial", "Disposed by Jury Trial"];
	   tags[5] = ['<img src="data:image/jpeg;base64,"/>', "Disposed by Non-Jury Trial", "Disposed by Non-Jury Trial"];
      
	   // Create style objects for all defined styles.

	   editor.ui.addRichCombo('dispostamp', {
		   label : "Final Disposition Stamp",
           title : "Final Disposition Stamp",
           className : 'dispoStamp',
           multiSelect : false,

           panel : {
              css : [ config.contentsCss, '/javascript/ckeditor/skins/moono/editor.css', '/style/ICMS.css?1.4' ]
           },

           init : function(){
        	   this.startGroup("Means of Final Disposition");
               for (var this_tag in tags){
                  this.add(tags[this_tag][0], tags[this_tag][1], tags[this_tag][2], tags[this_tag][3], tags[this_tag][4], tags[this_tag][5]);
               }
           },

           onClick : function(value){   
               editor.focus();
               editor.fire('saveSnapshot');
               editor.insertHtml(value);
               editor.fire('saveSnapshot');
            }
	   });
   }
});